import { Cell } from "./DayStyle"
import { Row } from "./DayStyle"
import { Day } from "./DayStyle"


export function DaySell({day}) {
    return (
        <Cell
            isWeekend={true}
        >
            <Row
                justifyContent={'flex-end'}
            >
                <Day>
                    {day.format('D')}
                </Day>
            </Row>
        </Cell>
    )
}
